using UnityEngine;namespace Core.Management{    public static partial class Main    {        public static void GetLastGameResult()        {            string typeString = Database.GetDatabaseString(DatabaseKeys.LastGameTypeDatabaseKey);            GameType type;            if (GameType.TryParse(typeString, true, out type))            {                switch (type)                {                    case GameType.MEMORY:                        var result = GetMemoryResult();                        UnityEngine.Debug.Log(result.SecondsLeft);                        MemoryResultFound?.Invoke(result);                        break;                    default:                        UnityEngine.Debug.LogError("INVALID LAST GAME TYPE");                        break;                }                Database.SetDatabaseString(DatabaseKeys.LastGameTypeDatabaseKey, string.Empty);            }            else            {                Debug.Log("NO LAST GAME FOUND");            }        }    }}